import React, {Fragment} from 'react';

const Footer=()=>{
    return(
        <Fragment>
        <footer className="bg-darktext-center">
        <p>&#169;2021 Sandeep Kr Chauhan. All Rights Reserved | Terms and Conditions</p>
        </footer>
        </Fragment>
    );
}
export default Footer;
